import React, {Component} from 'react';
import BottomNavBar from './BottomNavBar';

class Home extends Component {
    render () {
        return (
            <div className="homeBlock">
               <div className="map">
                    <BottomNavBar/>
                </div>
            </div>
        );
    }
}

export default Home;
